bool zmienno(int n)
{
	vector<int> res;
	for (int i=1; i*i<=n; i++)
		if (n % i == 0)
		{
			if (i == n / i)
				res.push_back(n / i);
			else
			{
				res.push_back(n / i);
				res.push_back(i);
			}
		}

	int odd = 0, even = 0;
	for (auto p : res)
	{
		if (p % 2 == 0)
			even++;
		else odd++;
	}

	return ((odd > 2*even) || (even > 2*odd));
}

